INSERT INTO toa_sms_receive VALUES ('29582','115','2014-09-05 17:29:58','规划中心近期工作完成情况及工作安排\r\n一、已完成工作\r\n1. 已组织完成专家组赴凉山州木里县，对烟岗、布西、跑马坪电站的调整规划报告进行现场踏勘工作；\r\n2.进一步编制完善“移民安置条例立法”省外调研报告；\r\n3.已完成水库移民管理信息系统省级分中心建设软件的验收工作；\r\n4.与后扶处讨论后扶方案规划大纲；\r\n5.“结对认亲”网络平台已上省局局长专题办公会，基本通过审查，并代社扶处向省政府草拟了专题报告。\r\n二、下周工作安排\r\n1.进一步修改完善“结对认亲”网站建设工作；\r\n2.完成凉山州木里县烟岗、布西、跑马坪电站规划调整报告相关资料的审核工作；\r\n3.完成后扶管理信息系统省级分中心软件的修改完善工作；\r\n4.积极参与歌咏比赛（共11人参加）、台球比赛（共3人参加）。\r\n\r\n                              四川省移民安置规划中心\r\n                                  2014年9月5日','4','2','1','','17233','1');
