INSERT INTO toa_sms_receive VALUES ('29725','67','2014-09-09 10:12:44','关于对甘孜州和资阳市开展贫困户、贫困村\r\n识别工作专项检查情况的报告\r\n\r\n局党组：\r\n    按照局务会的统一安排，8月27至30日和9月3至4日，党组成员、总会计师廖蔚带领施春华和覃佳，对甘孜州和资阳市开展贫困户、贫困村识别及驻村帮扶工作进行了专项检查，现将检查情况做如下汇报：\r\n一、基本情况。\r\n为真实掌握两地开展贫困户、贫困村识别及驻村帮扶工作的情况，检查组采取随机抽查的方式，对甘孜州的理塘县、丹巴县和资阳市的乐至县、安岳县进行了专项检查，共对4个乡（镇）和4个村的扶贫建档立卡情况。查看了相关文件、申请表、汇总表和公示情况，召开了座谈会。分别听取了县、乡、村三级关于扶贫建档立卡工作开展情况的汇报，查阅了相关档案资料，并与部分贫困户及非贫困户代表进行了座谈，了解群众对精准识别政策、程序和结果的知晓度和满意度，同时听取他们对扶贫工作的意见建议。\r\n总体看受督查的甘孜州和资阳市及4县对扶贫建档立卡工作宣传到位、工作规范、操作透明、工作保质有序。市（州）、县两级均高度重视该项工作，成立了专门的领导小组，召开了专题会，对工作人员进行了系统培训，进行了广泛宣传发动，安排了专门的工作经费。受检村在宣传贫困户识别工作上采取多种形式结合，通过村委会、村民小组会、粘贴公告、电话传达、村广播等方式广泛宣传，群众知晓度较高。受检县均在规定节点内完成了贫困户、贫困村各项识别工作，基层群众反映支持开展此项工作，贫困户脱贫愿望强烈，自愿填写申请，经村民委员会投票产生，并进行了公示，对识别出来的贫困户表示认可，党群、干群关系融洽。\r\n二、存在的问题\r\n通过对两地的检查，在贫困户的识别上还存在一些问题和不足：一是工作经费不足，部分开展工作困难。二是驻村干部人力欠缺，干部少，一岗多职，村级人员对微机操作不熟，能协助的大学生村官和驻村干部有限。三是档案管理不够规范，需要归档的资料不完善，出现涂改现象，贫困户的申请代写和数据登记不规范；公示的图文资料和对外出务工人员的电话记录等不齐全。四是对识别出来的贫困户、贫困村后期帮扶思考不足，存在“等”的思想。\r\n三、相关建议。\r\n根据检查的4个县，以及从基层和群众反映的意见和建议，现提出如下建议：\r\n（一）加大指导力度，规范好需录入的内容及准确性，避免反复修改、录入。\r\n（二）再次明确需归档的资料及保管范围、属地等，加强资料的审核，确保每一份资料完整、真实，经得起检验。\r\n（三）做好贫困村、贫困户识别工作的分类，制定帮扶措施，落实好帮扶政策。\r\n（四）落实好各级驻村干部，着手帮扶工作，加强驻村干部的培训，提高帮扶能力。\r\n专此报告，请审示。\r\n\r\n附：（甘孜州、资阳市）贫困户、贫困村识别工作专项           检查统计表\r\n  \r\n2014年9月8日<a href=\"data/uploadfile/67/20140909/20140909021241.xls\" target=\"_blank\">附件下载</a>','22','2','2','','17343','1');
