INSERT INTO toa_sms_receive VALUES ('31661','52','2014-09-16 16:32:16','国际合作与社会扶贫处有关情况\r\n\r\n\r\n一、研究制定改革创新指导意见或试点方案\r\n1、社会组织参与扶贫开发改革创新。省扶贫移民局等15部门已联合出台《关于印发〈四川省创新扶贫开发社会参与机制实施方案〉的通知》（川扶贫移民发[2014]214号）。\r\n2、《关于深入推进金融支持扶贫惠农工程，做好四川省扶贫开发金融服务工作的实施意见》。省政府已出台《四川省人民政府办公厅转发人行成都分行等部门关于深入推进金融支持扶贫惠农工程，做好四川省扶贫开发金融服务工作的实施意见》（川办函[2014]115号）。\r\n二、成效\r\n4、制定了第六批定点扶贫干部选派工作方案。该项工作省委组织部正在办理，待正式文件出台后，我们再转交。\r\n5、四川永鑫农牧集团股份有限公司等5家扶贫龙头企业贷款总额18.74亿元。此项工作属于四川省扶贫开发中心负责。\r\n6、特困农户与帮扶主体对接见面。今年初，完成了“结对认亲，爱心扶贫”试点活动， 190户农村特困户已经进行面对面结对帮扶。\r\n\r\n三、定点扶贫\r\n1、请提供22个在川定点扶贫中央单位派出的扶贫干部、培训情况、投入资金、引进资金和帮扶项目资料。据市（州）\r\n2、浙江、珠海扶贫协作项目、资金等情况。\r\n3、请提供省内对口定点扶贫派驻干部、帮扶项目、投入资金、引进资金等资料。\r\n今年上半年，以上3个方面的工作开展情况如下：\r\n配合22个在川定点扶贫的中央国家机关（单位）抓好帮扶工作落实，扎实推进239个省直部门（单位）对87个片区县的定点扶贫工作；深入推进东西扶贫协作，确定浙江帮扶四川藏区资金1.37亿元，重点实施帮扶项目75个，珠海市帮扶凉山州资金2397万元、项目37个正在协调落实。上半年，社会扶贫投引资达22亿元，引进人才2587名、项目4865个，覆盖贫困户63.67万户323.18万人。\r\n     4、社会各界参与扶贫，制定了《“结对认亲、爱心帮扶”活动实施方案》。今年已出台《四川省扶贫和移民工作局关于印发〈建立“结对认亲、爱心帮扶”活动平台实施方案（试行）〉的通知》（川扶贫移民发〔2014〕186号）。\r\n\r\n\r\n                        国际合作与社会扶贫处\r\n                         2014年9月16日','258','2','1','','18738','1');
